import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Main from '../pages/main/Main'
import Reshome from '../pages/restaurant/Reshome';
import Adminhome from '../pages/admin/Adminhome'
import Deliveryhome from '../pages/delivery/Deliveryhome'
import Signup from '../pages/main/Usersignup'
import Login from '../pages/main/Userlogin'

function AppRoutes() {
  return (
    <Routes>

      <Route path="/" element={<Main />}>
        <Route path="restauranthome" element={<Reshome/>}>
          <Route path="login" element={<Login />} />
          <Route path="signup" element={<Signup />} />
        </Route>

        <Route path="adminhome" element={<Adminhome/>}>
          <Route path="login" element={<Login />} />
          <Route path="signup" element={<Signup />} />
        </Route>

        <Route path="deliverypartnerhome" element={<Deliveryhome/>}>
          <Route path="login" element={<Login />} />
          <Route path="signup" element={<Signup />} />
        </Route>
      </Route>
    </Routes>
  );
}

export default AppRoutes;
